const modalContent = {
  about: {
    title: "About Us",
    content: (
      <>
        <p>
          At <strong>ASTRALIS Bank</strong>, we are committed to redefining the way people experience financial services.
        </p>
        <p>
          With a vision rooted in trust, transparency, and technology, we combine modern digital tools with personalized service.
        </p>
      </>
    )
  },
  contact: {
    title: "Contact Us",
    content: (
      <>
        <p>Have questions? Contact us:</p>
        <ul>
          <li>Email: <a href="mailto:support@astralisbank.com">support@astralisbank.com</a></li>
          <li>Phone: +1 (800) 123-4567</li>
        </ul>
      </>
    )
  }
};

export default modalContent;
